import React, { useState } from "react";
import "./Projects.css";

const Projects = () => {
  const [activeTab, setActiveTab] = useState(1);

  const handleTabClick = (tabIndex) => {
    setActiveTab(tabIndex);
  };

  const projects = [
    {
      title: "Project Title 1",
      description: "Lorem Ipsum is dummy text of the printing industry.",
      link: "https://example.com/project1", // Replace with your link
    },
    {
      title: "Project Title 2",
      description: "Lorem Ipsum is dummy text of the printing industry.",
      link: "https://example.com/project2", // Replace with your link
    },
    {
      title: "Project Title 3",
      description: "Lorem Ipsum is dummy text of the printing industry.",
      link: "https://example.com/project3", // Replace with your link
    },
    {
      title: "Project Title 4",
      description: "Lorem Ipsum is dummy text of the printing industry.",
      link: "https://example.com/project4", // Replace with your link
    },
  ];

  return (
    <div className="projects">
      <div className="projects-header">
        <h2>Projects</h2>
        <p>
          Lorem Ipsum is simply dummy text of the printing and typesetting
          industry. Lorem Ipsum has been the industry's standard dummy text
          ever since the 1500s, when an unknown printer took a galley of type
          and scrambled it to make a type specimen book.
        </p>
        <div className="projects-tabs">
          <button
            className={activeTab === 1 ? "active" : ""}
            onClick={() => handleTabClick(1)}
          >
            Tab 1
          </button>
          <button
            className={activeTab === 2 ? "active" : ""}
            onClick={() => handleTabClick(2)}
          >
            Tab 2
          </button>
          <button
            className={activeTab === 3 ? "active" : ""}
            onClick={() => handleTabClick(3)}
          >
            Tab 3
          </button>
        </div>
      </div>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <a
            key={index}
            href={project.link}
            target="_blank"
            rel="noopener noreferrer"
            className="project-card"
          >
            <h3>{project.title}</h3>
            <p>{project.description}</p>
          </a>
        ))}
      </div>
    </div>
  );
};

export default Projects;
